import { Typography, Button, ButtonGroup, Container, TextField} from '@mui/material';
import AcUnitOutlinedIcon from '@mui/icons-material/AcUnitOutlined';
import SendIcon from '@mui/icons-material/Send';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';

const useStyles = styled(TextField)({

    marginTop: 20,
    marginButtom: 20,
    display: 'block',
    color: 'error'

});

export default function Create() {
  return (
    <Container>
      create a new note: 
      <br /><br />
      <form noValidate autoComplete="off">

      <TextField 
      classes = {{root: useStyles.TextField}}
      label="Note title" variant="outlined" color = "secondary" fullWidth required/>

      </form>
    </Container>
  );
}
